var initInfomenu = function(index){
	$('body').append('' +
		'<div class="particle-menu">' +
		'  <input type="checkbox" id="menu-collapsed" name="menu-collapsed" checked="checked" />' +
		'  <div class="menu-content">' +
		'    <h2>[' + (index + 1) + '/' + samples.length + '] ' + samples[index].title + '</h2>' +
		'    <p>' + samples[index].description + '</p>' +
		'    <a class="prev" target="_blank" title="' + samples[(index - 1 + samples.length) % samples.length].title + '" href="' + samples[(index - 1 + samples.length) % samples.length].url + '"> <span class="icon">&lt;</span> prev</a>' + 
		'    <a class="next" target="_blank" title="' + samples[(index + 1 + samples.length) % samples.length].title + '" href="' + samples[(index + 1 + samples.length) % samples.length].url + '"> next <span class="icon">=</span></a>' + 
		'    <p style="clear: both;">' + 
		'      <br />' + 
		'      <br />' + 
		'      <a class="icon" target="_blank" title="ParticleSlider Homepage" href="http://particleSlider.com">S</a>' + 
		'      <a class="icon" target="_blank" title="ParticleSlider Issue Tracker" href="http://dev.zaku.eu/particleslider/issues">&#199;</a>' + 
		'      <a class="icon" target="_blank" title="Tamino Martinius on Twitter" href="http://twitter.com/TaminoMartinius">^</a>' + 
		'    </p>' +
		'  </div>' +
		'  <div class="menu-switch">' +
		'    <label class="collapse" for="menu-collapsed">&#171;</label>' +
		'    <label class="rise" for="menu-collapsed">&#187;</label>' +
		'  </div>' +
		'</div>'
	);
}